// Creating the gas particles
class CustomParticle2 extends THREE.Sprite {
	constructor(texture, direction, color = 0xf00ff0, lerpToColor = 0xffff00, lerpFactor = 0.03, opacitySubtractor = 0.0005, randomizer = 2, minRandScale = 1.0, maxRandScale = 1.5, defaultscale = 1.15, multiplyScalar = 1.025, rotationRandomizer = 0.1) {
		const material = new THREE.SpriteMaterial({color: color, map: texture, alphaMap: texture, alphaTest: 0.01, opacity: 0.2, transparent: true});
		const randScale =  Math.random() * randomizer;
		const scale =  10;
		super(material);
		this.startTime = clock.getElapsedTime();
		this.currentTime;
		this.scale.set(scale, scale, scale);
		this.randRotation = /*Math.random() * rotationRandomizer*/ 0.2;
		this.velocity = direction;
		this.multiplyScalar = multiplyScalar;
		this.lerpToColor = lerpToColor;
		this.lerpFactor = lerpFactor;
		this.opacitySubtractor = opacitySubtractor;
		this.material.blending = THREE.AdditiveBlending;
	}

	update() {

		this.position.add(this.velocity);
		this.scale.multiplyScalar(this.multiplyScalar);

		this.material.rotation += this.randRotation;
		//this.rotation.y += 0.5;
		this.material.color.lerp(new THREE.Color(this.lerpToColor), this.lerpFactor);

		this.material.opacity -= this.opacitySubtractor;

	}
}

// Create a particle emitter class
class ParticleEmitter2 {
	constructor(particleDirection, group) {
		this.particles = [];
		this.group = group;

		this.particleDirection = particleDirection;
		this.timer = 0;
		this.spawnFrequency = 0;
		this.firstParticleSpawned = false;
		this.group.position.copy(group.getWorldPosition(new THREE.Vector3()));
		scene.add(this.group);

	}

	emitParticle() {


		if (!this.firstParticleSpawned) {
			for (let i = 0; i < 4; i++) {
				const particle = new CustomParticle2(texture_2, this.particleDirection);
				this.group.add(particle);
				this.particles.push(particle);
			}

			this.firstParticleSpawned = true;

			clock.getDelta();
		}

		else{
			const delta = clock.getDelta();
			this.timer += delta;

			if (this.timer >= this.spawnFrequency) {
				const particle = new CustomParticle2(texture_2, this.particleDirection);
				particle.currentTime = clock.getElapsedTime();
				this.group.add(particle);
				this.particles.push(particle);

				this.timer -= delta;
			}
		}
	}

	updateParticles() {
		this.particles.forEach((particle) => {
			particle.currentTime = clock.getElapsedTime();
			particle.update();

			if((particle.currentTime - particle.startTime) > 1.9){
				//console.log("group: removed")
				particle.material.dispose();
				this.group.remove(particle);
			}
		});
	}
}

