function portalScene() {
	portalSceneTimer += 0.001;

	if(portalSceneTimer > 2){

		gameOverText.textContent = "Congratulations, you made it!";
		gameOverScreen.style.fontSize =  40 + "px";
		gameOverScreen.style.visibility = "visible";
		gameOverScreen.style.color = "white";
		gameOverScreen.style.backgroundColor = "beige";
		gameOverScreen.style.backgroundImage = "";
		gameOverScreen.style.opacity = 1;
	}	

	if(scene2Start === false){
		scene2Start = true;
		player.dispose();
		player.setScene(scene_2);
		player.setCamera(camera_2);
	} 

	//player.setScene(scene_2);
	//player.setCamera(camera_2);
	const time = clock_2.getElapsedTime();
	const  looptime = 50;
	const t = (time % looptime)/ looptime;
	const  t2 = ((time + (time / 40)) % looptime) / looptime;
	const  t3 = ((time + 10) % looptime) / looptime;

	let pos_1 = tubeMesh_1.geometry.parameters.path.getPointAt(t);
	let pos_2 = tubeMesh_1.geometry.parameters.path.getPointAt(t2);
	let pos_3 = tubeMesh_1.geometry.parameters.path.getPointAt(t3);

	colorAnim.x = Math.abs(Math.sin(time) * 1);
	colorAnim.y = Math.abs(Math.sin(time) * 1 - 1);
	colorAnim.z = Math.abs(Math.sin(time) * 1 - 2);

	tubeMesh_1.material.color.r = colorAnim.x; 
	tubeMesh_1.material.color.g = colorAnim.y; 
	tubeMesh_1.material.color.b = colorAnim.z;

	/*
	tubeMesh_1.material.emissive.r = colorAnim.x; 
	tubeMesh_1.material.emissive.g = colorAnim.y; 
	tubeMesh_1.material.emissive.b = colorAnim.z;
	*/

	light.intensity -= 0.01

	if(gameFinished === true){

		camera_2.position.copy(pos_1);
		camera_2.lookAt(pos_1);

		myPlayer2.rotation.y += 0.0003;
		myPlayer2.rotation.x -= 0.0001;

		myPlayer2.visible = true;
		myPlayer2.position.copy(pos_2);

		emitter.emitParticle();
		emitter.updateParticles();

		myPlayer2.children.map((obj)=>{
		if(obj.isMesh){
			obj.material.color.r += 0.0005;
			obj.material.color.g += 0.0005;
			obj.material.color.b += 0.0005;

			obj.material.emissive.r += 0.0005;
			obj.material.emissive.g += 0.0005;
			obj.material.emissive.b += 0.0005;
			}
		});
	}

	light.position.copy(pos_3).add(new THREE.Vector3(0, 4, 0));
}



