function getFoggyMaterial(fogDepth, fogColor, color, emissive, side){
  let material = new THREE.MeshStandardMaterial({ side: side});
	material.color.set(color);
	material.emissive.set(emissive);
  	material.onBeforeCompile = shader => {
    shader.uniforms.fDepth = {value: fogDepth};
    shader.uniforms.fColor = {value: new THREE.Color(fogColor)};
    shader.fragmentShader = `
      uniform float fDepth;
      uniform vec3 fColor;
    ` + shader.fragmentShader;
    shader.fragmentShader = shader.fragmentShader.replace(
      `#include <clipping_planes_fragment>`,
      `
      float planeFog = 1.0;
	  float planeFog2 = 1.0;
	  float planeFog3 = 1.0;
	  float planeFog4 = 1.0;
	  float planeFog5 = 1.0;
      //#if NUM_CLIPPING_PLANES > 0

        vec4 plane1;
		vec4 plane2;
		vec4 plane3;
		vec4 plane4;
		vec4 plane5;

        //#pragma unroll_loop
        //for ( int i = 0; i < UNION_CLIPPING_PLANES; i ++ ) {

          plane1 = clippingPlanes[ 0 ];
		  plane2 = clippingPlanes[ 1 ];
		  plane3 = clippingPlanes[ 2 ];
		  plane4 = clippingPlanes[ 3 ];
		  plane5 = clippingPlanes[ 4 ];
          //if ( dot( vViewPosition, plane.xyz ) > plane.w ) discard;
          planeFog = smoothstep(0.0, -fDepth, dot( vViewPosition, plane1.xyz) - plane1.w );
		  planeFog2 = smoothstep(0.0, -fDepth, dot( vViewPosition, plane2.xyz) - plane2.w);
		  planeFog3 = smoothstep(0.0, -fDepth, dot( vViewPosition, plane3.xyz) - plane3.w);
		  planeFog4 = smoothstep(0.0, -fDepth, dot( vViewPosition, plane4.xyz) - plane4.w);
		  planeFog5 = smoothstep(0.0, -fDepth, dot( vViewPosition, plane5.xyz) - plane5.w);

        //}
      //#endif
      `
    );
    shader.fragmentShader = shader.fragmentShader.replace(
      `#include <fog_fragment>`,
      `#include <fog_fragment>
       gl_FragColor.rgb = mix( gl_FragColor.rgb, fColor, (planeFog * planeFog2 * planeFog3 * planeFog4 * planeFog5) );
      `
    )
  }
  return material;
}


function switchToFoggyMaterial(){
	scene.traverse((obj)=>{

		if(obj.isMesh){
			//console.log("object: ", obj);
			const color = obj.material.color.getStyle();
			const emissive = obj.material.emissive.getStyle();

			obj.material.dispose();
			obj.material = getFoggyMaterial(fogDepth, fogColor, color, emissive, THREE.FrontSide);
		}
	})

}


