//Creates a p tag with 2 spans inside. One for labeling and one for the content

function UISubPanel (label = "", content = "", id = ""){

	if(typeof label === "string" && typeof content === "string" && typeof id === "string"){

		let uiSubPanel = document.createElement("p");
		uiSubPanel.className = "sub_panel";
		uiSubPanel.id = id;

		let uiSubPanelTag_label = document.createElement("span");
		uiSubPanelTag_label.innerHTML = "<b>" +  label.toUpperCase() + ": </b>";
		uiSubPanelTag_label.id = "sub_panel_name_label";

		let uiSubPanelTag_labelStyles = uiSubPanelTag_label.style;
		uiSubPanelTag_labelStyles.float = "left";
		uiSubPanelTag_labelStyles.clear = "left";
		uiSubPanelTag_labelStyles.margin = 2 + "px";
		uiSubPanelTag_labelStyles.fontSize = 1.8 + "vw";

		let subPanelTag_content = document.createElement("span");
		subPanelTag_content.id = "sub_panel_name_data";
		subPanelTag_content.textContent = " " + content.toUpperCase();

		let subPanelTag_contentStyles = subPanelTag_content.style;
		subPanelTag_contentStyles.float = "left";
		subPanelTag_contentStyles.clear = "left";
		subPanelTag_contentStyles.margin = 2 + "px";
		subPanelTag_contentStyles.textAlign = "left";
		subPanelTag_contentStyles.fontSize = 1.2 + "vw";

		uiSubPanel.appendChild(uiSubPanelTag_label);
		uiSubPanel.appendChild(subPanelTag_content);

		return uiSubPanel;
	}

};

