//Generic entity class
class Entity {
	constructor(entity){
		this.entity = entity;
		this.entity.position.y = 0;
		this.objBox = new THREE.Box3();
		this.objCenterPoint = new THREE.Vector3();
	}

	_CastRay(intersectables,int){

		this.objBox.setFromObject(this.entity);
		const raycaster = new THREE.Raycaster();
		raycaster.set(this.objBox.getCenter(this.objCenterPoint), this.entity.getWorldDirection(new THREE.Vector3()).multiplyScalar(int));


		this.intersects = raycaster.intersectObjects(intersectables);

	}
}

// Player class extends entity class
class PlayerEntity extends Entity {

	constructor(entity){
		super(entity);
	}
}

// Guard class extends entity class
class GuardEntity extends Entity {
	constructor(entity){
		super(entity);

		this.enemyDetected = false;

	}

	_EnemyDetector(myPlayer, enemyDetected){

		const directionVect = myPlayer.entity.position.clone(new THREE.Vector3()).sub(this.entity.position).normalize();
		const guardDirection = this.entity.getWorldDirection(new THREE.Vector3());

		if(guardDirection.dot(directionVect) > 0.9 && this.entity.position.distanceTo(myPlayer.entity.position) < 15 && this.enemyDetected === false){

			this.entity.children[1].target = myPlayer.entity;

			//console.log("this entity: ", this.entity.children[2]);

			this.entity.children[1].color.set("#ff0000");
			this.entity.children[2].material.emissive.set("#ff0000");
			//console.log("entity children: ",this.entity.children)

			this.enemyDetected = true;
			//return this.enemyDetected;

			//console.log("player is in front of guard:", guardDirection.dot(directionVect) );
			//console.log("player is in front of guard:", enemy_upper.entity.position.angleTo(myPlayer.entity.position));
			//console.log("Math.PI * 0.25:", Math.PI * 0.25 );
		}

		else{

			if(this.enemyDetected === false){
				this.entity.children[2].material.emissive.set("#2bff00");
				this.entity.children[1].color.set("#2bff00");
				this.entity.children[1].target = this.entity.children[3];
			}


		}
	}
}

class SwitchCage {
	constructor(obj){
		if(obj.type === "Group"){
			this.cage = obj;
		}

		this.currentPosition= new THREE.Vector3().copy(this.cage.position);

		this.lerpToPosition = new THREE.Vector3().addVectors(this.currentPosition, new THREE.Vector3(0, -4, 0));

	}

