			octaEmitter.group.position.copy(octaCrystal.position);
			octaEmitter_2.group.position.copy(octaCrystal.position);

			octaCrystalPos = octaCrystal.position.clone();

			scene.add(octaEmitter.group);
			scene.add(octaEmitter_2.group);
			break;
		case "tetrahedron_crystal":
			tetraCrystal = obj;
			tetraColor = obj.material.emissive.getStyle();
			//console.log("particle color :", particleColor);
			tetraEmitter = new CrystalParticleEmitter();
			tetraEmitter_2 = new CrystalParticleEmitter();
			tetraEmitter.group.position.copy(tetraCrystal.position);
			tetraEmitter_2.group.position.copy(tetraCrystal.position);

			tetraCrystalPos = tetraCrystal.position.clone();

			scene.add(tetraEmitter.group);
			scene.add(tetraEmitter_2.group);
			break;
	}
});


function checkSwitchActivation(){
	numActivatedSwitches = 0;
	switches.map((obj)=>{

		if(obj.userData.activated === true) numActivatedSwitches ++;

		if(numActivatedSwitches === 4) {
			//console.log("all switches are active");
			laserActivation(phaseIterator);
		}
	})
}

let stopLaserTimer = 100;

function laserActivation_2(time){
	dodecaCrystal.updateMatrix();
	dodecaCrystal.updateMatrixWorld();

	if(hexaEmitter_2.contact === true){
		stopLaserTimer -= 20;
		animateGeo();

		if(portalActivationCamera === true){
		portalActivationCameraTime += 0.001;

		if(portalActivationCameraTime > 1.5) {
			portalCameraActivation = false;
			player.setCamera(camera);
		}

	} 
	} 

	if(stopLaserTimer > 2){

		if(hexaEmitter_2.contact === false) dodecaBox.setFromCenterAndSize(dodecaCrystal.position, new THREE.Vector3(0.5, 0.5, 0.5));

		dodecaLerpToColor = dodecaCrystal.material.color.getStyle();

		hexaEmitter_2.emitParticle(dodecaCrystal.position, laserTex, hexaColor, dodecaLerpToColor);
		hexaEmitter_2.updateParticles(dodecaBox);
		//console.log("laser 1");

		tetraEmitter_2.emitParticle(dodecaCrystal.position, laserTex, tetraColor, dodecaLerpToColor);
		tetraEmitter_2.updateParticles(dodecaBox);

		octaEmitter_2.emitParticle(dodecaCrystal.position, laserTex, octaColor, dodecaLerpToColor);
		octaEmitter_2.updateParticles(dodecaBox);

		icosaEmitter_2.emitParticle(dodecaCrystal.position, laserTex, icosaColor, dodecaLerpToColor);
		icosaEmitter_2.updateParticles(dodecaBox);
	}
}




function laserActivation(iterator){

	portalActivationCamera = true;

	//tetraBox.setFromObject(tetraCrystal);
	if(icosaEmitter.contact === true) {

		tetraCrystal.rotation.y += 0.03;
		laserActivation_2();
	}
	else{

		player.setCamera(camera_3);

		hexaCrystal.updateMatrix();
		hexaCrystal.updateMatrixWorld();

		hexaLerpToColor = hexaCrystal.material.emissive.getStyle();

		hexaBox.setFromCenterAndSize(hexaCrystal.position, new THREE.Vector3(0.5, 0.5, 0.5));

		tetraEmitter.emitParticle(hexaCrystal.position, laserTex, tetraColor, hexaLerpToColor);
		tetraEmitter.updateParticles(hexaBox);
		//console.log("laser 2");
		if(tetraEmitter.contact === true){

			hexaCrystal.rotation.y += 0.03;

			octaCrystal.updateMatrix();
			octaCrystal.updateMatrixWorld();

			octaLerpToColor = octaCrystal.material.emissive.getStyle();

			octaBox.setFromCenterAndSize(octaCrystal.position, new THREE.Vector3(0.5, 0.5, 0.5));

			hexaEmitter.emitParticle(octaCrystal.position, laserTex, octaColor, octaLerpToColor);
			hexaEmitter.updateParticles(octaBox);
		}

		if(hexaEmitter.contact === true){

			octaCrystal.rotation.y += 0.03;

			icosaCrystal.updateMatrix();
			icosaCrystal.updateMatrixWorld();

			icosaLerpToColor = icosaCrystal.material.emissive.getStyle();

			icosaBox.setFromCenterAndSize(icosaCrystal.position, new THREE.Vector3(0.5, 0.5, 0.5));

			octaEmitter.emitParticle(icosaCrystal.position, laserTex, octaColor, icosaLerpToColor);
			octaEmitter.updateParticles(icosaBox)
		}

		if(octaEmitter.contact === true){

			icosaCrystal.rotation.y += 0.03;

			tetraCrystal.updateMatrix();
			tetraCrystal.updateMatrixWorld();

			tetraBox.setFromCenterAndSize(tetraCrystal.position, new THREE.Vector3(0.5, 0.5, 0.5));

			tetraLerpToColor = tetraCrystal.material.emissive.getStyle();

			icosaEmitter.emitParticle(tetraCrystal.position, laserTex, icosaColor, tetraLerpToColor);
			icosaEmitter.updateParticles(tetraBox);

		}
	}
}

function scene1(){
		const time = clock.getElapsedTime();

		signPost.material.emissive.lerpColors(signPostLerpColors[0], signPostLerpColors[1], Math.abs(Math.sin(time)));

		guardEntities.map((obj)=>{
			if(obj.enemyDetected === false){
				obj.entity.translateZ(0.1);
				obj._CastRay(walls, 1);

				if((obj.entity.name === "guard_entity_upper" || obj.entity.name === "guard_entity_lower" ) && (obj.intersects.length > 0 && obj.intersects[0].object.isMesh)){
					if(obj.intersects[0].object.name === "outer_wall_4" && obj.intersects[0].distance < 3) obj.entity.rotation.y = Math.PI * 0.5;
					if(obj.intersects[0].object.name === "outer_wall_4" && obj.intersects[0].distance < 3) obj.entity.rotation.y = Math.PI * 0.5;
					if(obj.intersects[0].object.name === "outer_wall_2" && obj.intersects[0].distance < 3) obj.entity.rotation.y = Math.PI * -0.5;
					if(obj.intersects[0].object.name === "outer_wall_2" && obj.intersects[0].distance < 3) obj.entity.rotation.y = Math.PI * -0.5;
				}

				if((obj.entity.name === "guard_entity_right" || obj.entity.name === "guard_entity_left" ) && (obj.intersects.length > 0 && obj.intersects[0].object.isMesh)){

					if(obj.intersects[0].object.name === "outer_wall_1" && obj.intersects[0].distance < 3) obj.entity.rotation.y = -Math.PI * 2;
					if(obj.intersects[0].object.name === "outer_wall_1" && obj.intersects[0].distance < 3) obj.entity.rotation.y = -Math.PI * 2;
					if(obj.intersects[0].object.name === "outer_wall_3" && obj.intersects[0].distance < 3) obj.entity.rotation.y = Math.PI;
					if(obj.intersects[0].object.name === "outer_wall_3" && obj.intersects[0].distance < 3) obj.entity.rotation.y = Math.PI;
				}


				obj._EnemyDetector(myPlayer, enemyDetected);

				if(obj.enemyDetected === true){
					enemyDetected = true;

					//return enemyDetected

				}

			}
		})

		if(enemyDetected){
			const deltaTime = clock.getElapsedTime();
			//console.log("enemy detected: ", enemyDetected + " deltatime: "  + deltaTime);
			switchCages.map((obj)=>{
				obj._CloseCage(0.05	);
			})
		}

		fogDelay = clock.getElapsedTime();

		if(enemyDetected === true ){


			emitterSphereArray.map((obj)=>{	
				obj.visible = true;
			});


			for(let emitter in particleEmitterArray){

				particleEmitterArray[emitter].emitParticle();
				particleEmitterArray[emitter].updateParticles();
				//console.log("why not here:");
			}

			if(fogTimer < 1){
				fogElapsedTime = clock.getElapsedTime();
				fogTimer ++;
			}

			//console.log("fogDelay:_" + fogDelay + " " + "fogElapsedTime_" + fogElapsedTime);
			if((fogDelay - fogElapsedTime) >= 1.2){

				if(gasPoisonOn === false){
					//console.log("got here");
					globalPlane_1 = new THREE.Plane( new THREE.Vector3( 0, -1, 0 ), -2.0 );
					globalPlane_right = new THREE.Plane( new THREE.Vector3( 1, 0, 0 ), 34.0 );
					globalPlane_left = new THREE.Plane( new THREE.Vector3( -1, 0, 0 ), 34.0 );
					globalPlane_front = new THREE.Plane( new THREE.Vector3( 0, 0, -1 ), 36.0 );
					globalPlane_back = new THREE.Plane( new THREE.Vector3( 0, 0, 1), 32.0 );
					renderer.clippingPlanes = [globalPlane_1 , globalPlane_right , globalPlane_left, globalPlane_front , globalPlane_back];
					fogDepth = 14;
					fogColor = 0xffff00;
					switchToFoggyMaterial();
					gasPoisonOn = true;

				}

				constantLerper.lerp(new THREE.Vector2(13, 0), 0.01);

				globalPlane_1.constant =  constantLerper.x;//(time * 0.15) < 15? (time * 0.15) : 15;
			}

			if(fogDelay - fogElapsedTime >= 3.5){

				gameOver = true;
				gameOverScreen.style.visibility = "visible";
				gameOverScreenOpacityValue.lerp(gameOverScreenLerpToOpacity, 0.02);
				gameOverScreen.style.opacity = gameOverScreenOpacityValue.x;

			}

			//gameOverScreen.style.opacity = 
		}

		checkSwitchActivation();

		if(!gameOver){
			keyControls();
			updateCrystalActivatedStatus();
		}


		toggleSwitchMainPanel(panels);

		//camera.position.add(myPlayer.entity.children[6].getWorldPosition(new THREE.Vector3()));

		camera.lookAt(myPlayer.entity.children[6].getWorldPosition(new THREE.Vector3()));
	}

function update( event ) {

	if(gameFinished === false){
		scene1();
	}

	else{

		console.log("here");
		portalScene();
	}

}

